import { EditorStatus } from "../../contexts/DraggableContext";
import react from "react";
import {useState} from "react";
type StatusDropdownProps = {
  currentStatus: EditorStatus;
  onChange: (status: EditorStatus) => void;
};


export const StatusDropdown = ({
  currentStatus,
  onChange,
}: StatusDropdownProps) => {
  return (
    <select
      value={currentStatus}
      onChange={(e) => onChange(e.target.value as EditorStatus)}
    >
      <option value={EditorStatus.NotStarted}></option>
      <option value={EditorStatus.Editing}></option>
      <option value={EditorStatus.Saved}></option>
    </select>
  );
};
